import React from 'react'
import Header from './../header/Header';
import Router from '../../router/Router'
import Footer from './../footer/Footer';

const Layout = () => {
  return (
    <>
    <Header/>
    <Router/>
    <Footer/>
    </>
  )
}

export default Layout
